            <div className='row'>
                <div className='col'>Hours open:<br></br>Mon: 11am - 9pm  Tues: 11am - 9pm<br></br>Wed: 11am - 9pm  Thur: 11am - 9pm<br></br>Fri: 12am - 12pm Sat: 12am - 12pm<br></br>Sun: 10am - 7pm</div>
